INSERT INTO `careers` (`id`, `title`, `summary`, `location`, `type`, `ordering`, `isActive`, `created_at`, `updated_at`, `content`) VALUES
(4, 'Digital Marketing', 'Minimum 1 year of experience with sales and digital marketing, Good computer skills, and comfortable with social media and more software in design.', 'Phnom Penh', 'Full time', 3, 1, '2023-10-31 11:24:23', '2025-05-28 04:11:00', '<div>\n<h4><span class=\"descript-title\">Job Description</span></h4>\n<div class=\"fs-14 descript-list\">&bull; Develop strategic sales and marketing to achieve targets.<br>&bull; Create, propose, and implement the overall digital marketing strategies such as Facebook, Instagram<br>&bull; Regular post and replying comments, messages on social media.<br>&bull; Work with advertising and even team to increase market results.<br>&bull;And other tasks assigned by management</div>\n</div>\n<div>\n<h4><span class=\"descript-title\"><br>Job Requirements</span></h4>\n<div class=\"fs-14 descript-list\">&bull; Minimum 1 years of experience with sales and digital marketing<br>&bull; Good computer skills and comfortable with social media and more software in design.<br>&bull; Strong planning ability, know how to plan efforts and resources to reach targets</div>\n</div>\n<div>&nbsp;</div>\n<div>\n<p><span style=\"font-size: 14pt;\"><strong>How to Apply</strong></span></p>\n<p>- Apply for a job by clicking the \'Get Started\' button, and then send your CV to <a href=\"https://t.me/camgotech\">Camgotech Telegram&nbsp;</a><br><br>Telegram number: 069 565 956</p>\n<p>Email:&nbsp;<a href=\"mailto:info@camotech.com\">info@camotech.com</a></p>\n<p>Website: <a href=\"https://www.camotech.com\">www.camotech.com</a>&nbsp;<br><br>Thank You!!</p>\n</div>\n<div>\n<p>&nbsp;</p>\n</div>'),
(5, 'Mobile App Developer', 'Experience in mobile development (IOS & Android) more than 1 year', 'Phnom Penh', 'Freelance', 1, 1, '2023-11-20 02:17:13', '2025-05-28 04:11:32', '<p><span style=\"font-size: 14pt;\"><strong>Job Requirements</strong></span><br><br>- Experience in mobile development (IOS &amp; Android) more than 1<br>year<br>- Knowledge of third-party libraries and APIs<br>- Experience as a team leader<br>- Working knowledge of the general mobile landscape,<br>architectures, trends, and emerging technologies<br>- Experience in Web Technology (PHP, HTML/CSS3,<br>AngularJS/React, or Kotlin ro Flutter) is a plus<br>- Teamwork, honesty, flexibility, creative ideas, hard-working<br>- Able to work under pressure and longer-term</p>\n<p><br><span style=\"font-size: 14pt;\"><strong>How to Apply</strong></span></p>\n<p>- Apply for a job by clicking the \'Get Started\' button, and then send your CV to <a href=\"https://t.me/camgotech\">Camgotech Telegram&nbsp;</a><br><br>Telegram number: 069 565 956</p>\n<p>Email:&nbsp;<a href=\"mailto:info@camotech.com\">info@camotech.com</a></p>\n<p>Website: <a href=\"https://www.camotech.com\">www.camotech.com</a>&nbsp;<br><br>Thank You!!</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>'),
(6, 'Full-Stack Developer', 'Experienced with any Front-end frameworks such as Vue, React, and Angular and Back-end frameworks such as Laravel and React', '', 'Freelance', 2, 1, '2023-12-19 03:39:59', '2025-05-28 04:11:22', '<h4><span class=\"descript-title\">Job Description</span></h4>\n<div class=\"fs-14 descript-list\">&bull; Proven experience as a Web Developer with at least 1+ year of professional experience.<br>&bull; Well understanding of Web development fundamentals, including HTML, CSS, and JavaScript.<br>&bull; Experienced with any Front-end frameworks such as Vue, React, or Angular.<br>&bull; Experienced with any Back-end frameworks such as Laravel and React<br>&bull; Experienced with CSS Framework and UI Component (eg. Bootstrap, Materialize, Semantic UI, etc.) is an advantage.<br>&bull;Able to plan and magnitude about work to finish any tasks in the timeline.</div>\n<div class=\"fs-14 descript-list\">\n<div>\n<div class=\"fs-14 descript-list\">&nbsp;</div>\n</div>\n<div>&nbsp;</div>\n<div>\n<p><span style=\"font-size: 14pt;\"><strong>How to Apply</strong></span></p>\n<p>- Apply for a job by clicking the \'Get Started\' button, and then send your CV to <a href=\"https://t.me/camgotech\">Camgotech Telegram&nbsp;</a><br><br>Telegram number: 069 565 956</p>\n<p>Email:&nbsp;<a href=\"mailto:info@camotech.com\">info@camotech.com</a></p>\n<p>Website: <a href=\"https://www.camotech.com\">www.camotech.com</a>&nbsp;<br><br>Thank You!!</p>\n</div>\n</div>');

