INSERT INTO `faqs` (`id`, `question`, `answer`, `ordering`, `isActive`, `created_at`, `updated_at`) VALUES
(2, 'Why is a website so important for all Businesses?', 'A website helps your business build brand awareness and reach new customers. It showcases your products, services, and contact numbers and generates awareness about them. You can do SEO to increase your online visibility, reach the right audience, and further expand your business.', 1, 1, '2023-10-25 08:05:24', '2023-12-19 04:00:15'),
(3, 'What is a mobile app and its importance?', 'Importance of Mobile Applications in Everyday Life and Businesses\nApps are like interesting and creative decorations that define mobile phones\' best purposes. These are making the use of technology feasible and intelligible. Developers strive to bring out the most convenient functionalities in mobile apps that humans can access to tone down their tasks and make them amusing.', 2, 1, '2023-10-25 08:05:57', '2023-12-19 04:02:23'),
(4, 'Why is digital marketing so important?', 'In terms of your business, digital marketing allows you to connect with prospective and existing customers, which is vital for business and brand awareness. Digital marketing is important because it allows you to get creative and stand out from your competitors in congested markets', 3, 1, '2023-10-25 08:06:20', '2023-12-19 04:04:40'),
(7, 'What do you need to have to create a beautiful website?', 'You can make an appointment with the Camgotech team to get advice on how to design your website. After agreeing with the price, you need some necessary information such as a logo, contact number and, if possible, a better company profile. Camgotech guarantees that you will get the most beautiful website for your business.', 4, 1, '2023-12-19 04:09:20', '2023-12-19 04:34:04');

