INSERT INTO `news` (`id`, `title`, `summary`, `content`, `isDisplayHomepage`, `image`, `ordering`, `isActive`, `created_at`, `updated_at`, `metaKeyword`, `metaDesc`) VALUES
(3, 'ចំនួន iPhone ដាក់លក់លើទីផ្សារសកលជាង 14% ក្នុងឆ្នាំ 2023 នេះ ត្រូវបានផលិតចេញពីប្រទេសឥណ្ឌា', '', '<p>សហរដ្ឋអាមេរិកបានរៀបចំគម្រោងដករោងចក្រចេញពីប្រទេសចិន អស់រយៈពេលប៉ុន្មានឆ្នាំមកហើយ ដោយនៅក្នុងឆ្នាំ 2023 គឺប្រទះឃើញមានសកម្មភាពកាន់តែច្រើនទៅៗផងដែរ។ ជាពិសេស Apple ដែលជាក្រុមហ៊ុនធំក៏មានផ្ទេរផលិតកម្មខ្លះទៅកាន់ប្រទេសឥណ្ឌា និងប្រទេសវៀតណាមជាបណ្ដើរៗហើយ ដោយចំនួន iPhone សរុបដែលមានដាក់លក់លើទីផ្សារសកលខ្ទង់ 12% - 14% នៅក្នុងឆ្នាំ 2023 នេះ គឺត្រូវបានផលិតចេញពីប្រទេសឥណ្ឌា។<br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_LZC9RPTX3LS8n7uEVVw2vZCr3ccJo4ziwxDw4fhL.png\" alt=\"2.png\" width=\"100%\" height=\"auto\"></p>\n<p>លោក Ming-Chi Kuo ដែលជាអ្នកវិភាគជំនាញម្នាក់ គឺជាអ្នករាយការណ៍ដំណឹងនេះមកឲ្យបានដឹង ហើយគាត់ក៏បាននិយាយប្រាប់ទៀតថា Apple កំពុងមានគម្រោងដំឡើងផលិតកម្ម iPhone នៅក្នុងប្រទេសឥណ្ឌា ឲ្យឡើងទៅដល់ចំនួនខ្ទង់ 20% - 24% សម្រាប់ឆ្នាំ 2024 ថែមទៀតផង។ ហេតុដូច្នេះហើយ ផលិតកម្មសម្រាប់ផលិតផល Apple នៅក្នុងប្រទេសចិន នឹងកាន់តែថយចុះបន្ដិចម្ដងៗមិនខាន ស្របនឹងពេលដែលប្រទេសវៀតណាម ក៏កំពុងតែមានផលិតកម្មលើ AirPods និង MacBooks ជាបណ្ដើរៗរួចមកហើយ។<br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_6ZoQA1qiiOqIczNrXTrrd3mFFaJrPibTWlW4vmwg.png\" alt=\"3.png\" width=\"100%\" height=\"auto\"><br><br>គួរបញ្ជាក់ផងដែរថា រោងចក្រផលិតកម្មរបស់ Apple ជាង 75% - 80% នៅក្នុងប្រទេសឥណ្ឌា គឺត្រូវបានគ្រប់គ្រងដោយ Foxconn ដដែល។ នាពេលអនាគតទៅ ប្រទេសឥណ្ឌាអាចក្លាយទៅជាទីតាំងផលិត iPhone ធំជាងគេលើពិភពលោក ដោយលែងអាចជាប្រទេសចិនទៀតក៏ថាបាន។<br><br></p>\n<p>ប្រភពពីៈ Cambo-report</p>', 1, '/news/CamGoTech_gsWL0q25UfdLlD6AWsu8g7Urb8YMGukFCGajaSSI.jpg', 96, 1, '2023-10-24 18:50:48', '2024-04-01 15:14:52', '', ''),
(4, 'ស្មាតហ្វូនអេក្រង់បត់តម្លៃខ្ទង់ 400-500 ដុល្លារពី Samsung ត្រូវបានលេចឮថានឹងមកដល់ក្នុងឆ្នាំ 2024', '', '<p>ភាគច្រើននៅពេលដែលយើងឃើញស្មាតហ្វូនអេក្រង់បត់ស៊េរីថ្មី ប្រាកដជាដឹងថាវាមានតម្លៃថ្លៃជាក់ជាមិនខាន ចាប់ផ្ដើមពីជិត 1 ពាន់ដុល្លារឡើងទៅ សម្រាប់ពេលបច្ចុប្បន្ននេះ។ ដោយសារតែគូប្រជែងកំពុងតែកើនឡើងច្រើន ហេតុដូច្នេះហើយ Samsung អាចគ្រោងនឹងប្រកាសចេញស្មាតហ្វូនអេក្រង់បត់ស៊េរីថ្មី ជាមួយតម្លៃសមរម្យជាងមុនមែនទែនក្នុងឆ្នាំ 2024 បើយោងតាមរបាយការណ៍ចុងក្រោយ។<br><br><img src=\"https://api.camgotech.acitytech.com/uploads/content/CamGoTech_dldc49EdCUbm1XXu4IFmsuDbhcGnJ9pLtcIpgcBk.png\" alt=\"\" width=\"100%\" height=\"auto\"><br><br></p>\n<p>ពិតមែនហើយ ប្រភពលេចធ្លាយមួយដែលមានគណនីឈ្មោះថា Revegnus បានចែករំលែកដំណឹងថ្មីមួយអំពី Samsung កំពុងរៀបចំស្មាតហ្វូនអេក្រង់បត់លំដាប់មធ្យម ជាមួយនឹងតម្លៃខ្ទង់ $400 ទៅ $500 ដើម្បីទាក់ទាញអតិថិជនទាំងថ្មីទាំងចាស់ ឲ្យមកសាកល្បងប្រើប្រាស់ស្មាតហ្វូនអេក្រង់។</p>\n<p>ដោយសារតែមានតម្លៃសមរម្យបែបនេះ ក៏មានគេរំពឹងទុកថា វានឹងប្រើប្រាស់គ្រឿងលំដាប់មធ្យម ដូចជាជាឈីបលំដាប់មធ្យម ក៏ដូចជាបច្ចេកវិទ្យាអេក្រង់បត់ ដកយកមកប្រើបន្ដពី ស្មាតហ្វូនអេក្រង់បត់លំដាប់កំពូលជំនាន់មុន។</p>\n<p><img src=\"https://api.camgotech.acitytech.com/uploads/content/CamGoTech_lEuliKpt68Sma8vYgPTKiev9jAvL8WoW6Hoi9DFe.jpg\" alt=\"\" width=\"100%\" height=\"auto\"></p>\n<p>ប្រភពមួយទៀតក៏សង្ស័យថាម៉ូឌែលនោះអាចជា Galaxy Z Flip6 FE ដោយវាមានលក្ខណៈបត់បែបពីទំហំស្មាតហ្វូនមកកាន់រូបរាងតូច។ ដោយឡែក Galaxy Z Fold ដែលមានលក្ខណៈបត់បែបពីថេប្លេតទៅជាទំហំស្មាតហ្វូនវិញនោះ គឺនៅមិនទាន់មានដំណឹងថា នឹងអាចមានម៉ូឌែលលំដាប់មធ្យមនៅឡើយទេ។</p>\n<p><img src=\"https://api.camgotech.acitytech.com/uploads/content/CamGoTech_d2SVtRkaypVRNZdgr5F87XTrmWPfgbaMLnIBTU7t.png\" alt=\"\" width=\"100%\" height=\"auto\"></p>\n<p>ប្រសិនបើ Samsung អាចសម្រេចបានការប្រកាសចេញ ស្មាតហ្វូនអេក្រង់បត់តម្លៃខ្ទង់ 400-500 ដុល្លារ នោះប្រាកដជាគួរឲ្យចាប់អារម្មណ៍មែនទែន។ ជាការពិតណាស់ មិនត្រឹមតែ Samsung ប៉ុណ្ណោះទេ ដោយនៅក្នុងឆ្នាំក្រោយៗ ក្រុមហ៊ុនផលិតស្មាតហ្វូនផ្សេងៗទៀត ក៏អាចនឹងប្រើប្រាស់ចេញស្មាតហ្វូនលំដាប់មធ្យមដូចគ្នា។<br><br><iframe title=\"YouTube video player\" src=\"https://www.youtube.com/embed/PRRO2svW2PI?si=Pa3_eI9rEaisQaZQ\" width=\"560\" height=\"315\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n<p><iframe src=\"https://www.youtube.com/embed/J2qU_4yLCvI\" width=\"850\" height=\"477\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n<p>ប្រភពពីៈ Cambo-Report</p>', 1, '/news/CamGoTech_x6wxNwQC8OyqBN8w2hSLdOAZ39EmL4Fjw20GW5pA.jpg', 99, 1, '2023-10-24 18:51:38', '2025-02-12 03:18:21', '', ''),
(5, 'Samsung ប្រកាសពី AI ថ្មីមួយមានសមត្ថភាពអាចបកប្រែភាសាផ្សេងៗបាន ក្នុងអំឡុងពេលនិយាយទូរសព្ទផ្ទាល់តែម្តង', '', '<p>ដូចដែលប្រិយមិត្តភាគច្រើនបានដឹងស្រាប់ហើយថា បច្ចេកវិទ្យា AI សព្វថ្ងៃនេះគឺមានជឿនលឿនក៏ដូជាមានភាពវិវត្តន៍យ៉ាងឆាប់រហ័សមិនគួរឲ្យជឿ។ តួយ៉ាង គឺមានក្រុមហ៊ុនបច្ចេកវិទ្យាធំៗរបស់ពិភពលោកជាច្រើនដែលបានចូលរួមការអភិវឌ្ឍន៍ក្នុងវិស័យបច្ចេកវិទ្យា AI នេះដូចជាក្រុមហ៊ុនល្បីឈ្មោះ OpenAI, Google, Microsoft ជាដើម។ ហើយកាលពីថ្មីៗនេះក្រុមហ៊ុន xAI ថ្មីរបស់លោក Elon Musk ក៏ចូលមកប្រឡូកក្នុងវិស័យនេះផងដែរ ក្រៅពីក្រុមហ៊ុនទាំងនោះ Samsung ក៏ត្រូវបានគេមើលឃើញថាជាក្រុមហ៊ុនដែលមានលទ្ធភាពអាចផលិត/អភិវឌ្ឍន៍បច្ចេកវិទ្យា AI បានផងដែរ។</p>\n<p><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_GJsiEuQcpseyaDmb2i0jLOPaC7HRf2sgORgV0z0r.jpg\" alt=\"3.1.jpeg\" width=\"100%\" height=\"auto\"></p>\n<p>ជាក់ស្តែង ក្រុមហ៊ុនបច្ចេកវិទ្យាយក្សកូរ៉េខាងត្បូង Samsung ផ្ទាល់ម្សិលមិញនេះក៏បានប្រកាសពីយុគ្គសម័យថ្មីនៃបច្ចេកវិទ្យា Galaxy AI ថ្មីរបស់ខ្លួនផងដែរ ហើយគេបានបង្ហើបថា AI Live Translate Call នឹងក្លាយជាមុខងារ AI ថ្មីដំបូងគេបង្អស់ដែលវាមានសមត្ថភាពអាចបកប្រែភាសាផ្សេងៗបានភ្លាមៗនៅក្នុងអំឡុងពេលអ្នកប្រើប្រាស់និយាយទូរសព្ទផ្ទាល់តែម្តង។ អ៊ីចឹង យើងអាចរំពឹងទុកមុនបានថា វាទំនងជានឹងមកដល់ក៏ដូចជាប្រកាសចេញជាផ្លូវការជាមួយនឹង Galaxy S24 Series ដែលត្រៀមបង្ហាញខ្លួនជាផ្លូវការនៅដើមឆ្នាំ 2024 ខាងមុខនេះ។</p>\n<p>បើយោងតាម Samsung បានឲ្យដឹងថា សំឡេងនិងអត្ថបទដែលបានបកប្រែទៅជាភាសាផ្សេងៗនោះវានឹងលោតបង្ហាញនៅលើអេក្រង់ឲ្យបានដឹងពេលយើងក៏ដូចជាភាគីម្ខាងទៀតនិយាយទូរសព្ទឆ្លើយឆ្លងគ្នាជាមួយគ្នាផ្ទាល់តែម្តង។ លើសពីនេះ វាអាចនឹងមានភ្ជាប់មកនៅក្នុងកម្មវិធីផ្សេងៗរបស់ Samsung ផងដែរដោយមិនចាំបាច់ដំឡើងកម្មវិធីបកប្រែភាសាផ្សេងៗពីខាងក្រៅមកនោះទេ។ ចំណុចនេះយើងអាចសន្និដ្ឋានបានថា កម្មវិធីក្នុងស្មាតហ្វូនជំនាន់ក្រោយៗរបស់ក្រុមហ៊ុន Samsung នឹងមានភ្ជាប់ដោយ AI មកជាមួយតែម្តងពិសេសគឺ AI Live Translate Call និងមាន AI មួយចំនួនទៀតដែលគេពុំទាន់បង្ហើបក៏ថាបាន។<br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_AT64kGEqUlW2fULyfSpiwByI0XzGste6wg8602id.jpg\" alt=\"3.2.jpeg\" width=\"100%\" height=\"auto\"></p>\n<p>មួយវិញទៀត នៅក្នុងរបាយការណ៍ដដែលនោះគេពុំទាន់មានការបញ្ជាក់ច្បាស់លាស់នៅឡើយទេថា Samsung នឹងប្រើប្រាស់មុខងារ AI Live Translate Call នោះផ្ទាល់ក្នុងការបកប្រែភាសាស្របពេលនិយាយទូរសព្ទផ្ទាល់ ឬក៏គេប្រើប្រាស់កម្មវិធីដាច់ដោយឡែកមួយទៀតយ៉ាងណានោះទេ។ ទន្ទឹមនឹងនេះដែរ ក៏មានទស្សនៈមួយចំនួនទៀតនិយាយថា ប្រសិនបើក្រុមហ៊ុន Samsung ដាក់ឲ្យមុខងារ AI នោះមានភ្ជាប់មករួចជាស្រេចក្នុងស្មាតហ្វូនជំនាន់ក្រោយរបស់ខ្លួន នោះនឹងធ្វើឲ្យអ្នកប្រើប្រាស់កាន់តែមានភាពងាយស្រួលដោយមិនចាំបាច់ប្រើកម្មវិធីបកប្រែភាសាផ្សេងៗទៀតនោះទេ។</p>\n<p>ដូច្នេះ យើងអាចស្រមៃបានថាម្ចាស់ស្មាតហ្វូនជំនាន់ក្រោយៗរបស់ Samsung នឹងលែងបារម្ភច្រើនទាក់ទងនឹងបញ្ហាមិនចេះភាសានានាតទៅទៀតហើយពេលនិយាយទូរសព្ទជាមួយនឹងជនជាតិបរទេស។ ម្យាងវិញទៀត ការប្រកាសអំពីយុគ្គសម័យថ្មីនៃ Galaxy AI របស់ខ្លួននេះគេក៏អាចនឹងមានពង្រឹងលើផ្នែកប្រព័ន្ធសុវត្ថិភាព ក៏ដូចជាឯកជនភាពរបស់អ្នកប្រើប្រាស់ឲ្យបានកាន់តែខ្ពស់ផងដែរ។</p>\n<p><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_ZKAEGcLtbO6PVtIlclFeQZaxdPWaPei8tR9wWLB4.jpg\" alt=\"3.3.jpeg\" width=\"100%\" height=\"auto\"></p>\n<p>ជាចុងក្រោយ ដំណឹងទាក់ទងនឹងការប្រកាសចេញស្មាតហ្វូនកំពូល Galaxy S24 Series ជំនាន់ថ្មីពេលនេះត្រូវបានគេរំពឹងថានឹងធ្វើឡើងនៅថ្ងៃទី 17 មករា ឆ្នាំ 2024 ខាងមុខនេះ។ ដូចនេះ នៅពេលនោះរាល់ដំណឹងលេចឮជាច្រើនកន្លងមកគ្រាប់យ៉ាងនឹងត្រូវបានលាតត្រដាងទាំងស្រុងហើយរួមទាំងបច្ចេកវិទ្យា AI ចេញពីក្រុមហ៊ុន Samsung ផ្ទាល់និងក្លាយជាព្រឹត្តិការណ៍ដ៏ធំប្រចាំឆ្នាំរបស់ខ្លួនទៀតផង។</p>\n<p>&nbsp;ប្រភពពីៈ Cambo-Report</p>', 0, '/news/CamGoTech_sfh9uc1xlqXm92En2ddL02Sf8GHFL7At6E2AuOqj.jpg', 100, 1, '2023-10-24 18:52:15', '2024-04-01 15:14:12', '', ''),
(8, 'MacBook Pro 14” និង 16” ជំនាន់ថ្មីបានប្រកាសចេញជាមួយឈីប M3, M3 Pro និង M3 Max', '', '<p>ព្រឹត្តិការណ៍ Scary Fast ដែលបានធ្វើឡើងនៅព្រឹកថ្ងៃទី 31 តុលា 2023 ថ្មីៗកន្លងទៅនេះ បានធ្វើការដាក់បង្ហាញនូវ MacBook Pro 14&rdquo; និង 16&rdquo; ជំនាន់ក្រោយ សុទ្ធតែប្រើប្រាស់នូវឈីប M3 Series ជំនាន់ក្រោយផងដែរ។ ស្របនឹងពេលដែលម៉ូឌែល 14&rdquo; មានប្រើប្រាស់ឈីប M3, M3 Pro និង M3 Max រីឯម៉ូឌែល 16&rdquo; វិញមានប្រើប្រាស់ឈីប M3 Pro និង M3 Max តែម្ដង។<br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_TPtVT0iBgUjsV7Inv6F93xYoSSJWUgwdEgIzM1K4.jpg\" alt=\"4.1.jpeg\" width=\"100%\" height=\"auto\"><br><br></p>\n<p>ឈីប M3 មានផ្ទុកនូវ CPU ចំនួនឡើងដល់ 8-core និងមាន GPU ចំនួនឡើងទៅដល់ 10-core ក៏ដូចជាឈីប M3 Pro មានផ្ទុកនូវ CPU ចំនួនឡើងដល់ 12-core និងមាន GPU ចំនួនឡើងទៅដល់ 18-core និងឈីបកំពូល M3 Max មានផ្ទុកនូវ CPU ចំនួនឡើងដល់ 16-core និងមាន GPU ចំនួនឡើងទៅដល់ 40-core ឯណោះ។ មិនថាបន្ទះឈីបប្រភេទមួយណានោះឡើយ M3, M3 Pro និង M3 Max សុទ្ធតែគាំទ្រ RAM ដល់ 24GB, 36GB និង 128GB ដូចៗគ្នាទាំងអស់។</p>\n<p>Apple បានធ្វើការប្រៀបធៀបឈីប M3 ជាមួយនឹងឈីប M1 ជំនាន់ដំបូង ហើយបានអះអាងមកថា M3 Max នៅលើ MacBook Pro 14&rdquo; និង 16&rdquo; ថ្មីនេះ គឺមានល្បឿនលឿនជាងឈីប M1 Max នៅលើ MacBook Pro 16&rdquo; ដល់ទៅ 2.5x ដង និងមានល្បៀនលឿនជាង MacBook ប្រើប្រាស់ Intel ដល់ទៅ 11x ដងថែមទៀតផង។</p>\n<p><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_4baUV05wCarLanN99MIf947isSpcOeyyqEJmDKZx.jpg\" alt=\"4.2.jpeg\" width=\"100%\" height=\"auto\"></p>\n<p>ជាការពិតណាស់ ឈីប M3 Series ត្រូវបានបង្កើតឡើងដោយបច្ចេកវិទ្យា 3nm ដែលសន្យាថានឹងជួយផ្ដល់ជូនកម្លាំងកាន់តែខ្លាំង ហើយព្រមទាំងជួយសន្សំថាមពលបានប្រសើរជាងមុនទៀត។ Apple បាននិយាយថាពួកគេបានប្រើប្រាស់បច្ចេកវិទ្យាថ្មីហៅថា Dynamic Caching ដែលអនុញ្ញាតឲ្យ GPU ដំណើរការឆ្លើយតបជាមួយ Hardware បានភ្លាមៗលឿនជាងមុន និងធានាថាវាប្រើប្រាស់ចំនួន RAM ណាដែលចាំបាច់ប៉ុណ្ណោះ។</p>\n<p><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_IJrfetkquwdb2NORmScAO8FMaV5bVmaDIGIiXawe.jpg\" alt=\"4.3.jpeg\" width=\"100%\" height=\"auto\"></p>\n<p>រាល់គ្រប់ម៉ូឌែលទាំងអស់នៅលើ MacBook Pro 14&rdquo; និង 16&rdquo; ជំនាន់ក្រោយនេះ សុទ្ធតែបំពាក់នូវបន្ទះអេក្រង់ Liquid Retina XDR ដែលមានពន្លឺជាងមុន 20% សម្រាប់ Content SDR ទូទៅ, មានពន្លឺ 1,000nits រូបភាពធម្មតា និងមានពន្លឺភ្លឺដល់ 1,600nits សម្រាប់វីដេអូ HDR, មានផ្ទុកនូវ Speakers សរុបចំនួន 6 គ្រាប់ និងនៅមានថ្ងាស់ឆកដដែល ជាមួយកាមេរ៉ា Webcam 1080p ជាដើម។</p>\n<p>ក្រៅពីនេះទៅទៀត Apple ក៏បានផ្ដល់ជូននូវជម្រើសពណ៌ខ្មៅថ្មីមួយទៀត ដែលមានឈ្មោះហៅថា Space Black សម្រាប់ជម្រើសម៉ាស៊ីនប្រើប្រាស់ឈីប M3 Pro និង M3 Max រួមជាមួយនឹងជម្រើសពណ៌ទឹកប្រាក់ Sliver មួយទៀត។ ដោយឡែកសម្រាប់ម៉ាស៊ីន M3 ធម្មតា នឹងមានជម្រើសពណ៌ទឹកប្រាក់ Sliver និងពណ៌ប្រផះ Space Grey ដូចមុនដដែល។</p>\n<p><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_5Iefp7oVqsDlFcsSAgc6bv8nY6CNbmu3SlbzM0mQ.jpg\" alt=\"4.4.jpeg\" width=\"100%\" height=\"auto\"></p>\n<p><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_7wExTOXso7oerqyjnmuhFcJCKirRv1tJ1SBhRS74.jpg\" alt=\"4.5.jpeg\" width=\"100%\" height=\"auto\"><br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_bNwJlrHtOSrLlIKgMtR53qauxSyHr38CGGuL3Iu0.jpg\" alt=\"4.6.jpeg\" width=\"100%\" height=\"auto\"><br><br>Apple កំពុងតែបើកឲ្យធ្វើការកុម្ម៉ង់ទិញចាប់ពីថ្ងៃនេះតទៅហើយ និងមានលក់ជាផ្លូវការនៅថ្ងៃទី 7 វិច្ឋិកា 2023 ឆាប់ៗខាងមុខនេះ នៅសហរដ្ឋអាមេរិក។ ចំពោះម៉ូឌែល MacBook Pro 14&rdquo; ប្រើប្រាស់ឈីប M3 មានតម្លៃ 1,599 ដុល្លារឡើងទៅ (8GB RAM + 512GB SSD), ម៉ូឌែល MacBook Pro 14&rdquo; ប្រើប្រាស់ឈីប M3 Pro មានតម្លៃ 1,999 ដុល្លារឡើងទៅ (18GB RAM + 512GB SSD) និងម៉ូឌែល MacBook Pro 16&rdquo; ប្រើប្រាស់ឈីប M3 Pro មានតម្លៃ 2,499 ដុល្លារឡើងទៅ (18GB RAM + 512GB SSD)។<br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_R3qaAsZS30fDWEfVbDQCNmhkUwo9t10vNRPWOqXs.jpg\" alt=\"4.7.jpeg\" width=\"100%\" height=\"auto\"></p>\n<p>&nbsp;</p>\n<p>ប្រភពពីៈ&nbsp; Cambo-Report</p>', 1, '/news/CamGoTech_lGKU1KIbiTkBqfysEZfAeKZFiywbRq9xw76XHzAi.jpg', 90, 1, '2023-11-13 01:08:28', '2025-03-14 02:36:04', 'Camgotech News, Tech News, Website Design in Cambodia', 'Camgotech News, Tech News, Website Design in Cambodia'),
(15, 'Tim Cook នាយក​ប្រតិបត្តិ Apple រកប្រាក់ចំណូលបានត្រឹមតែ 63.2 លានដុល្លារកាលពីឆ្នាំ 2023', '', '<p>បើយោងតាមរបាយការណ៍ចុងក្រោយបានចុះផ្សាយថា នាយក​ប្រតិបត្តិ Apple តាំងពីឆ្នាំ 2011 មក ដែលត្រូវជាលោក Tim Cook បានប្រទះឃើញការធ្លាក់ចុះនៃប្រាក់ចំណូលនៅក្នុងឆ្នាំ 2023 ផងដែរ។ ជាការពិតណាស់ បើប្រៀបធៀបទៅនឹងឆ្នាំ 2022 បានដាក់បង្ហាញថា ប្រាក់ចំណូលសរុបប្រចាំឆ្នាំបានធ្លាក់ចុះខ្ទង់ 36% នៅក្នុងឆ្នាំ 2023 កន្លងទៅនេះ។<br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_G2UIPGl7PYXO3r26y0psZljOgm3iYVmsvlRdLh3e.jpg\" alt=\"\" width=\"100%\" height=\"auto\"><br><br></p>\n<p>ប្រាក់ចំណូលសរុបរបស់លោក Tim Cook នៅ Apple គឺបូកបញ្ចូលគ្នារវាងប្រាក់ខែសរុបប្រចាំឆ្នាំ 3 លានដុល្លារ, ប្រាក់ទទួលបានពីភាគហ៊ុន Apple ចំនួន 47 លានដុល្លារ, ប្រាក់រង្វាន់ Bonus បន្ថែមចំនួន 10.7 លានដុល្លារ និងចំនួន 2.5 លានដុល្លារទទួលបានមកពីផ្នែកផ្សេងៗទៀត។ ហេតុដូច្នេះហើយ កាលពីឆ្នាំ 2023 គាត់រកបានចំណូលខ្ទង់ 63.2 លានដុល្លារ បើប្រៀបធៀបទៅនឹងឆ្នាំ 2022 វិញ គឺរកបានរហូតដល់ទៅ 99.4 លានដុល្លារឯណោះ។</p>\n<p>លើសពីនេះទៅទៀតនៅក្នុងឆ្នាំ 2023 នេះ Apple បានចំណាយប្រាក់អស់ $820,309 សម្រាប់ផ្នែកការពារសុវត្ថិភាពរបស់លោក Tim Cook និងបានចំណាយអស់ខ្ទង់ $1,621,468 គ្រាន់តែសម្រាប់ការធ្វើដំណើរតាមផ្លូវអាកាសប៉ុណ្ណោះ តាមរយៈយន្តហោះឯកជន។<br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_gHUZIijPJfWAnAggQoLt7gcXdKnzEZmaDCp3wQHC.jpg\" alt=\"\" width=\"100%\" height=\"auto\"></p>\n<p><br>ប្រភពពីៈ Cambo-report</p>', 1, '/news/CamGoTech_4uZGHwPve2Xqi2VGMiknlrn8KN7RtjppRId75l1C.jpg', 80, 1, '2024-01-15 02:43:01', '2024-04-01 15:17:50', '', ''),
(16, 'Galaxy S24 Series ប្រកាសចេញជាផ្លូវការ ដោយបានផ្ដល់ជូនមុខងារ AI ស្ទើរតែគ្រប់ទីកន្លែង', '', '<p>ព្រឹត្តិការណ៍ Galaxy Unpacked បានរៀបចំធ្វើឡើងកាលពីមុននេះបន្ដិច ដោយយើងឃើញមានការប្រកាសចេញ Galaxy S24 Series រួមជាមួយនឹងមុខងារ AI ជាច្រើនមានទាំងនៅក្នុង Gallery, មុខងារ Search, ក្ដារចុច Keyboard, នៅពេលខលនិយាយទូរសព្ទ, នៅពេលឆែកអ៊ីនធើណេត និងនៅពេលកត់ចំណាំ Note ថែមទៀតផង។ កំណែអាប់ដេត OS ត្រូវបានដំឡើងទៅរហូតដល់ 7 ឆ្នាំឯណោះ សម្រាប់ត្រកូល Galaxy S24 Series ថ្មីៗទាំងអស់នេះ។<br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_URIl1q7V2I9kkSmn0AI8G0nW2ZJfpz7bEE3OH7QX.jpg\" alt=\"\" width=\"100%\" height=\"auto\"><br><br></p>\n<p><strong>តួខ្លួន<br></strong><br>តួខ្លួន TItanium បានបង្ហាញខ្លួននៅលើ S24 Ultra ជាលើកដំបូង ខណៈពេលដែល Galaxy S24/S24+ ទទួលបានតួខ្លួន Armor aluminum 2.0 រឹងមាំជាងមុន។ គ្រប់ម៉ូឌែល S24 Series ទាំងអស់សុទ្ធតែមានជម្រើសពណ៌ចំនួន 4 ដូចគ្នាៗ។ បន្ទះអេក្រង់រាបស្មើគឺមាននៅលើ S24 Series ទាំងអស់ សូម្បីតែ S24 Ultra ជាមួយម៉ូឌែល S24/S24+ គឺមានគែមចំហៀងជ្រុងជាងមុន និងសុទ្ធតែមានគែមអេក្រង់ខ្លីៗជាងមុនដូចៗគ្នា ហើយអាវការពារទឹកនិងធូលី IP68 នៅតែមានវត្តមាននៅលើនេះដដែល។</p>\n<ul>\n<li>S24 Ultra មានទំហំ 6.8&rdquo; 2,600nits Dynamic AMOLED 2X QHD+ / 1Hz-120Hz Refresh Rate</li>\n<li>S24 Plus មានទំហំ 6.7&rdquo; 2,600nits Dynamic AMOLED 2X QHD+ / 1Hz-120Hz Refresh Rate</li>\n<li>S24 មានទំហំ 6.2&rdquo; 2,600nits Dynamic AMOLED 2X FHD+ / 1Hz-120Hz Refresh Rate</li>\n</ul>\n<p>កញ្ចក់របស់ Galaxy S24 Series ត្រូវបានការពារដោយ Corning Gorilla Armor ជំនាន់ថ្មី។<br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_KxS2OdNc6Sz1SjlL5g1lmBclGRzVSH9PSIJIGJCn.jpg\" alt=\"\" width=\"100%\" height=\"auto\"><br><br></p>\n<p><strong>កម្លាំងម៉ាស៊ីន</strong></p>\n<p>ពិតមែនហើយ បន្ទះឈីប Exynos បានត្រឡប់មកវិញនៅលើម៉ូឌែលលំដាប់កំពូល ជាមួយឈីប Exynos 2400 សម្រាប់ S24/S24+ ដោយឡែកឈីប Snapdragon 8 Gen 3 នៅប្រើប្រាស់លើ S24 Ultra ជាពិសេស។ លើកលែងតែសហរដ្ឋអាមេរិក និងប្រទេសកាណាដា ដែលទទួលបានឈីប Snapdragon 8 Gen 3 គ្រប់ម៉ូឌែលទាំងអស់។ ចំណែកឯប្រព័ន្ធបន្ថយកម្ដៅនៅលើ S24 Series ក៏ត្រូវបានពង្រឹងបន្ថែមដូចគ្នា ជាមួយនឹងប្រសិទ្ធិភាពខ្ពស់ជាងមុនរហូតដល់ 1.9x បើប្រៀបធៀបទៅនឹងជំនាន់មុន។&nbsp;<br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_HItTFsgac3rNFVLjSKGd4SJGWHMym2ERdsy9gVNL.jpg\" alt=\"\" width=\"100%\" height=\"auto\"><br><br></p>\n<p><strong>មុខងារ AI ថ្មីៗ</strong></p>\n<ul>\n<li>Circle to Search with Google - ប្រើប្រាស់ប៊ិក S Pen ឬម្រាមដៃ ដើម្បីងាយស្រួលគូសរង្វង់លើវត្ថុឬទីតាំងណា ដែលអ្នកចង់ស្វែងរកព័ត៌មានលម្អិតបន្ថែម។</li>\n<li>AI Translate - បកប្រែភាសាជាសំឡេងនៅពេលកំពុងតែនិយាយឆ្លងឆ្លើយទូរសព្ទដោយផ្ទាល់<br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_Ijli7pg2Mc7AHpS1LRWCTYzItHkJTrjo3pDLCZx2.jpg\" alt=\"\" width=\"100%\" height=\"auto\"><br><br></li>\n<li>Chat Assist - បកប្រែភាសានៅលើឆាត/ប្រអប់សារ នៅក្នុងកម្មវិធីសារដើមរបស់ស្មាតហ្វូន និងសូម្បីតែកម្មវិធីសារផ្សេងៗទៀតដូចជា Instagram, WhatsApp និង Line បានថែមទៀតផង។</li>\n<li>Suggest replies &amp; change tone of the text - ប្រើប្រាស់ AI ដើម្បីសម្រួលពាក្យសារឆ្លើយតបទៅកាន់អ្នកដទៃ ដែលមាន AI ជួយណែនាំដោយផ្ទាល់ ដើម្បីឲ្យឃើញមានជំនាញនិងមានពាក្យឆ្លើយតបត្រឹមត្រូវល្អ។ គួរបញ្ជាក់ថាមុខងារនេះដំណើរការតែនៅលើ Samsung Keyboard ប៉ុណ្ណោះ។<br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_6gzKLcZPIbvYaQkpiMUOtc9qAQ2KzxGBTDnGlGGG.jpg\" alt=\"\" width=\"100%\" height=\"auto\"><br><br></li>\n<li>Note Assist (Samsung Note) - សង្ខេបកំណត់ត្រាវែងៗមកជាឃ្លាខ្លីៗវិញ</li>\n<li>Record Assist (Samsung voice recorder) - ថតសំឡេងឲ្យប្រែទៅជាអក្សរ និងអាចបែកចែកសំឡេងអ្នកនិយាយបានដោយស្វ័យប្រវត្ថិ។ ព្រមទាំងមានមុខងារសង្ខេបសំឡេងវែងៗយូរនាទី មកជាឃ្លាអក្សរខ្លីៗបាន។</li>\n<li>Web Assist (Samsung browser) - សង្ខេបអត្ថបទវែងៗមកជាឃ្លាខ្លីៗដើម្បីឲ្យងាយអាន។<br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_9K1A6ieCwDxxinbenMs4ptFdTinLNdsPAtOQxItO.jpg\" alt=\"\" width=\"100%\" height=\"auto\"></li>\n</ul>\n<p>&nbsp;</p>\n<ul>\n<li>Always-on display ថ្មីអាចបង្ហាញរូប Wallpapers ពេញអេក្រង់បាន។</li>\n<li>AI Generative Wallpapers - ធ្វើការបង្កើតរូប Wallpapers តាមចំណង់ចំណូលចិត្តរបស់អ្នកប្រើប្រាស់ ដោយប្រើប្រាស់ជំនួយពី AI តែម្ដង។</li>\n<li>AI នៅក្នុងកម្មវិធី Gallery - មុខងារ Generative Transform ធ្វើការបំពេញរូបភាព និងផ្លាស់ទីតាំងរបស់វត្ថុនៅក្នុងរូបភាពបានជាមួយ AI ថ្មីនេះ។ ស្រដៀងគ្នានឹងមុខងារ AI នៅលើ Adobe Photoshop ប៉ុន្ដែពេលនេះបានមកដល់ S24 Series ហើយ។<br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_0DybQRJXL4YVfvdOQn9uVILt4F9r7zRR5Vw5NzSN.jpg\" alt=\"\" width=\"100%\" height=\"auto\"><br><br></li>\n<li>ទាំងអស់នេះជាមុខងារ AI គោលៗដែល Samsung បានដាក់បង្ហាញ ជាមួយប្រភេទ Cloud-Based លាយជាមួយ On-Device ផង ហើយក៏នៅមានមុខងារ AI ផ្សេងៗមួយចំនួនទៀតដូចគ្នា។</li>\n</ul>\n<p><strong>កាមេរ៉ា</strong></p>\n<p>Galaxy S24 Ultra ទទួលបានការអាប់ដេតច្រើនជាងគេ ដោយរួមមានការទទួលបានជម្រើសពង្រីក 5x ថែមមួយទៀត ដែលមានគុណភាពប្រសើរជាង 5x នៅលើ S23 Ultra ផងដែរ។ មុខងារ Night Mode នៅលើ S24 Ultra ក៏ត្រូវបានអាប់ដេតឲ្យប្រសើរជាងជំនាន់មុនដូចគ្នា ដែលទទួលបានលទ្ធផលភ្លឺ ហើយមានគុណភាពច្បាស់ បើយោងតាមការដាក់បង្ហាញដោយ Samsung ផ្ទាល់។</p>\n<ul>\n<li>Galaxy S24 Ultra លេនគោល 200MP OIS + លេនពង្រីក Telephoto 10MP (OIS, 3x Optical Zoom) + លេនពង្រីក Periscope 50MP (OIS, 5x Optical Zoom/100x Digital Zoom) + លេនទូលាយ Ultra-wide 12MP</li>\n<li>Galaxy S24 Plus លេនគោល 50MP OIS + លេនពង្រីក Telephoto 10MP (OIS, 3x Optical Zoom/30x Digital Zoom) + លេនទូលាយ Ultra-wide 12MP</li>\n<li>Galaxy S24 លេនគោល 50MP OIS + លេនពង្រីក Telephoto 10MP​ (OIS, 3x Optical Zoom/30x Digital Zoom) + លេនទូលាយ Ultra-wide 12MP</li>\n</ul>\n<p>AI Zoom for Photo - ជាមុខងារ AI ជំនួយដំឡើងគុណភាពរូបនៅពេលថត Zoom ជិតឲ្យឃើញកាន់តែច្បាស់ថែមទៀត។<br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_ZdhXih5hBmZahKqP1P6KaoNTZGajCRoT6jKLgWSf.jpg\" alt=\"\" width=\"100%\" height=\"auto\"><br><br>ចំពោះកាមេរ៉ាខាងមុខវិញគឺមានទំហំ 12MP ដូចគ្នាគ្រប់ម៉ូឌែលទាំងអស់ ដោយចំណុចពិសេសនោះគឺស្ថិតត្រង់ថា S24 Series មានសមត្ថភាពអាចឆ្លាស់បានគ្រប់លេនទាំងអស់ សូម្បីតែលេនខាងមុខផងដែរ នៅពេលកំពុងថតវីដេអូ 4K@60FPS ផងដែរ។ បើគុណភាពថតវីដេអូខ្ពស់បង្អស់ គឺមានរហូតដល់កម្រិត 8K@24/30fps ដដែល ប៉ុន្ដែ Samsung ថាវាថតបាន framerate រលូនជាងមុន និងអាចថត 8K នៅក្នុងកម្រិត 5x Zoom បានលើកដំបូង។<br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_DSiND2qNzaiScrK8Y0rvIUNEUFDuEx7UHpXkotZJ.jpg\" alt=\"\" width=\"100%\" height=\"auto\"></p>\n<p>&nbsp;</p>\n<p><strong>តម្លៃដាក់លក់នៅសហរដ្ឋអាមេរិក&nbsp;</strong></p>\n<ul>\n<li aria-level=\"1\">Galaxy S24 Ultra តម្លៃ $1299 ឡើងទៅ</li>\n<li aria-level=\"1\">Galaxy S24 Plus តម្លៃ $999 ឡើងទៅ</li>\n<li aria-level=\"1\">Galaxy S24 តម្លៃ $799 ឡើងទៅ<br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_qKfC1Xj85KovvICAqO518xJZosZuSOHU23fv4PoS.jpg\" alt=\"\" width=\"100%\" height=\"auto\"></li>\n</ul>\n<p><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_Fr4g6AGdpTxi0FtRNIyj888yUWxeYhisUbeJLopV.jpg\" alt=\"\" width=\"100%\" height=\"auto\"><br><br></p>\n<p><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_ieDaaqmBpmMS1ldV5xQF0I7YyM1Z9cf7z04FjC2e.jpg\" alt=\"\" width=\"100%\" height=\"auto\"><br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_mkd85fBuBNKImF4oBTEHrnxwx9RXzk9vO6RDwhb5.jpg\" alt=\"\" width=\"100%\" height=\"auto\"><br><br><br>ប្រភពពីៈ Cambo-report</p>', 1, '/news/CamGoTech_Ppg6OwqofH5TqxZw9qTziLLdN3gF7wvlUTiCIr2e.jpg', 88, 1, '2024-01-18 07:11:00', '2024-04-01 15:17:38', '', ''),
(17, 'ប្រើវេបសាយកាត់ផ្ទៃខាងក្រោយ (PNG) តែមិនច្បាស់! តោះមកស្គាល់វេបសាយកាត់ផ្ទៃខាងក្រោយបានច្បាស់ ឥតគិតថ្លៃ គ្រាន់តែ Upload រូបចូល', '', '<p>មានវេបសាយមួយចំនួន ដែលយើងអាចប្រើ សម្រាប់កាត់រូបផ្ទៃខាងក្រោយចេញបានយ៉ាងងាយ ប៉ុន្តែវេបសាយទាំងនោះ គឺត្រូវការឱ្យយើងចំណាយលុយទៅលើវា ដើម្បីកាត់រូបចេញមក មានកម្រិតភាពច្បាស់ខ្ពស់ ប៉ុន្តែក្នុងករណីដែលយើងប្រើមុខងារ Free គឺកម្រិតភាពច្បាស់របស់វាមានតិចណាស់ ពោលគឺរូបភាពរបស់យើង ពិបាកទទួលយក។<br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_XjjQnT1cJFRLFOhNgtpUGJE0aiPwsApHUIocgfNE.jpg\" alt=\"\" width=\"100%\" height=\"auto\"><br><br>យ៉ាងណាមិញ ថ្ងៃនេះចាបខៀវសូមណែនាំវេបសាយមួយ ដែលអាចកាត់រូបភាពផ្ទៃខាងក្រោយឱ្យយើងបានស្អាត និងច្បាស់ដូចរូបភាពដើម១០០%។ <a href=\"https://www.adobe.com/express/feature/image/remove-background\" target=\"_blank\" rel=\"noopener\">www.adobe.com/remove-background</a> គឺជាវេបសាយរបស់ក្រុមហ៊ុន adobe និងដាក់ឱ្យយើងកាត់រូបផ្ទៃខាងក្រោយ ដោយឥតគិតថ្លៃ ក្នុងកម្រិតភាពច្បាស់ ទោះមិនបង់លុយក៏ដោយ។<br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_CulDYgQceWGNLK5pb9v57KothoBIGTh7I5D1dU0J.jpg\" alt=\"\" width=\"100%\" height=\"auto\"><br><br>សម្រាប់របៀបចូលទៅប្រើប្រាស់ គឺដូចទៅនឹងវេបសាយដទៃទៀតដែរ ពោលគឺក្នុងវេបសាយនេះ គ្រាន់តែលោកអ្នក Upload file រូបភាពចូល ងាយនឹងធ្វើការកាត់ផ្ទៃខាងក្រោយចេញ ដោយស្វ័យប្រវត្តិតែម្ដង។ តោះសាកល្បងប្រើឥឡូវនេះ ទូរសព្ទ កុំព្យូទ័រ ប្រើបានទាំងពីរ។<br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_2AbxgPgm7xEoryERJUFfhOfw4OqDeeFOzqXTmVST.jpg\" alt=\"\" width=\"100%\" height=\"auto\"><br><br><br>ប្រភពពីៈ Tech-cambodia</p>', 0, '/news/CamGoTech_hiLWFRPsUd3V1ev6PLogGTs1p29Y3cKKr59VRzXr.jpg', 90, 1, '2024-01-18 07:57:09', '2025-03-14 02:35:51', 'Camgotech News, Tech News, Website Design in Cambodia', 'Camgotech News, Tech News, Website Design in Cambodia'),
(18, 'Apple ប្រើប្រាស់ឧបករណ៍នេះដើម្បីអាប់ដេត iPhone ថ្មីៗ ដោយមិនចាំបាច់យកចេញពីប្រអប់ឡើយ', '', '<div class=\"bg-white-section pt-4\">\n<div class=\"content-container\">\n<p>កាលពីពេលថ្មីៗនេះ Apple Store នៅសហរដ្ឋអាមេរិក បានចាប់ផ្ដើមប្រើប្រាស់ឧបករណ៍ថ្មីប្លែកមួយ ដែលមានសមត្ថភាពធ្វើការអាប់ដេត iPhone ថ្មីៗនៅក្នុងប្រអប់បាន ដោយមិនចាំបាច់ហែកបើកចេញនោះទេ។ ហេតុដូច្នេះហើយ អតិថិជននឹងទទួលបានបទពិសោធន៍កាន់តែល្អប្រសើរ ព្រោះមិនចាំបាច់ចំណាយពេលបន្ថែម ដើម្បីអាប់ដេតឡើងទៅជំនាន់ចុងក្រោយដោយខ្លួនឯងទៀតទេ។<br><br></p>\n<p><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_yAkQnKJkLcsY4lEnR7SGSgpnD9uKSPYjv2VCGvnH.jpg\" alt=\"\" width=\"100%\" height=\"auto\"><br><br>ជាធម្មតាប្រសិនបើមានកំណែអាប់ដេតចេញជំនាន់ថ្មី ដូចនេះ iPhone ដែលនៅក្នុងប្រអប់នឹងអាចអាប់ដេតឡើងទៅបានទេ លុះត្រាតែមានអ្នកទិញយកទៅប្រើ ហើយបានបើកយកមកអាប់ដេតម្ដងទៀត។</p>\n<p>អ៊ីចឹងមធ្យោបាយថ្មីនេះ នឹងជួយសន្សំពេលវេលារបស់អ្នកប្រើប្រាស់ ក៏ដូចជាផ្ដល់ជូនបទពិសោធន៍ពិសេសបំផុត នៅពេលដែលទិញ iPhone ថ្មីយកទៅប្រើប្រាស់។</p>\n</div>\n</div>\n<div class=\"bg-white-section\">\n<div class=\"content-container\">\n<p>បើមើលទៅតាមរូបភាពខាងក្រោម គឺបានដាក់បង្ហាញឲ្យឃើញថា ឧបករណ៍មួយនេះមានសមត្ថភាពអាប់ដេតបានច្រើនប្រអប់ថែមទៀតផង ដោយមិនមែនម្ដងមួយប្រអប់ៗនោះទេ។<br><br></p>\n<p><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_v1GLH3DilMMFNFW2DPsOUOCiRhfYVBQiytxuYJsP.jpg\" alt=\"\" width=\"100%\" height=\"auto\"></p>\n<p><br>នេះជាបច្ចេកវិទ្យាមួយដែលមិនធ្លាប់ឃើញមានពីមុនមកនោះទេ ហើយវាពិតជាចាំបាច់ណាស់សម្រាប់ iPhone ពីព្រោះប្រព័ន្ធប្រតិបត្តិការ iOS ឧស្សាហ៍ទទួលបានកំណែអាប់ដេតថ្មីៗគួរសម។<br><br>ប្រភព៖ Cambo-Report</p>\n</div>\n</div>', 0, '/news/CamGoTech_PJYfqkPJxerVryP58QbwE1jLlzw7g6rtzJrcBqjR.jpg', 70, 1, '2024-04-01 15:13:21', '2025-05-28 04:23:32', 'Camgotech News, Tech News, Website Design in Cambodia', 'Camgotech News, Tech News, Website Design in Cambodia'),
(19, 'រូបរាងរបស់ Galaxy S25 Ultra អាចមានម៉ូតឌីហ្សាញបែបនេះ អេមដែរ', '', '<div class=\"detail-content\">\n<div class=\"w-100\">\n<div class=\"bg-white-section pt-4\">\n<div class=\"content-container\">\n<p>ប្រភពលេចធ្លាយល្បីឈ្មោះមួយ បានធ្វើការចែករំលែកម៉ូតឌីហ្សាញរបស់ Galaxy S25 Ultra សម្រាប់ដើមឆ្នាំក្រោយនេះ ដោយមានលក្ខណៈស្រដៀងទៅនឹង S24 Ultra ប៉ុន្ដែមិនដូចទាំងស្រុងនោះឡើយ។ ជាក់ស្ដែង Galaxy S25 Ultra រំពឹងទុកថានឹងមានជ្រុងរាងមូលបន្ដិចវិញ ដោយលែងជាកាច់ជ្រុងបែបមុតស្រួចដូចមុនទៀតហើយ។</p>\n<p><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_YYsvewydqCtmHIL6E3jlFwzwkdE8peEMdT3Nb1V4.png\" alt=\"\" width=\"100%\" height=\"100%\"></p>\n<p><strong><img src=\"https://storage.googleapis.com/camboreport/post/202408/8D6GJKeJsjpxNX2OEWrr0gxr9nIPGSuyWueMUSyd.jpg\" width=\"1000\" height=\"100\"></strong></p>\n<p>បន្ទះអេក្រង់ខាងមុខរបស់ Galaxy S25 Ultra ក៏លេចធ្លាយមកថា នឹងមានគែមខ្លីជាងមុន ធំទូលាយជាងមុន ក៏ដូចជាមានទីតាំងកាមេរ៉ាខាងក្រោយនៅដដែល ប៉ុន្ដែមានម៉ូតស៊ុមកាមេរ៉ាថ្មីផងដែរ។ ទម្ងន់របស់ S25 Ultra អាចនឹងស្ថិតនៅត្រឹមតែ 219g ស្រាលជាង S24 Ultra បន្ដិច ដែលមានទម្ងន់ 232g ហើយបើប្រៀបធៀបទៅនឹង iPhone 16 Pro Max មានទម្ងន់ 227g វិញ។</p>\n<p><img src=\"https://storage.googleapis.com/camboreport/post/202409/fYCKUNZaEgTHBR7tY3sbe29XMCVnRUxtxF43mcWg.png\" alt=\"\" width=\"1000\" height=\"563\"></p>\n</div>\n</div>\n<div class=\"bg-white-section\">\n<div class=\"content-container\">\n<p>ទោះបីជាស្រាលជាងមុនក៏ពិតមែន ប្រភពមួយចំនួនបានលើកឡើងមកថា ថាមពលថ្មរបស់ S25 Ultra នឹងនៅមានទំហំធំ 5,000mAh ដដែល ហើយនៅអាចធ្វើឲ្យតួខ្លួនតូចជាងមុនបន្ដិច ដោយសារតែការកាត់បន្ថយគែមអេក្រង់មកកាន់តែខ្លីជាងមុនបាន។</p>\n<p><img src=\"https://storage.googleapis.com/camboreport/post/202409/AB7gkDaoRX3N23j8EubHSzLyKS9Fr8ulBRQATtfp.png\" alt=\"\" width=\"1000\" height=\"563\"></p>\n<p>Samsung ទំនងជាប្រកាសចេញ Galaxy S25 series ជាមួយឈីប Snapdragon 8 Gen 4 For Galaxy នៅក្នុងអំឡុងខែមករា 2025 ដូចកាលពីពេលប្រកាសចេញ Galaxy S24 series អ៊ីចឹងដែរ។</p>\n<p><img src=\"https://storage.googleapis.com/camboreport/post/202409/ZOlpPXPM5DR2yFiVPF2fMSb52eb03fpqYdAGz711.png\" alt=\"\" width=\"1000\" height=\"563\"></p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"relate-product\">\n<div class=\"bg-white-section\">\n<div class=\"py-lg-0 py-md-0 py-sm-4 py-xs-4 py-4\">&nbsp;</div>\n</div>\n</div>\n<div class=\"pt-3 pb-2 ps-lg-0 ps-md-0 ps-sm-2 ps-xs-2 ps-2\"><span class=\"source\">ប្រភព៖ Cambo Report</span></div>', 0, '/news/CamGoTech_AkscfCHS8m649siUCVd0S0I7Rbns6eGhlMIT5Caa.jpg', 50, 1, '2024-09-14 07:09:39', '2025-05-28 04:23:58', 'Camgotech News, Tech News, Website Design in Cambodia', 'Camgotech News, Tech News, Website Design in Cambodia'),
(20, 'Bluetooth 6.0 ផ្ដល់ជូនសុវត្ថិភាពខ្ពស់ជាងមុន និងស្វែងរកឧបករណ៍បានប្រសើរជាងមុន', '', '<div class=\"detail-content\">\n<div class=\"w-100\">\n<div class=\"bg-white-section pt-4\">\n<div class=\"content-container\">\n<p>Bluetooth Special Interest Group (SIG) បានប្រកាសចេញ Bluetooth 6.0 ជាផ្លូវការហើយ ដោយបានធ្វើការពង្រឹងបន្ថែមទៅលើផ្នែកសុវត្ថិភាព និងមុខងារស្វែងរកទីតាំងរបស់ឧបករណ៍ណាមួយ ដើម្បីឆាប់ស្វែងរកបានឆាប់ជាងមុនទៀត។</p>\n<p><img src=\"https://storage.googleapis.com/camboreport/post/202409/X9Z4exV7dZAhsvrGBvRV03wPqrGmrdZsUcQdK5hJ.webp\" alt=\"\" width=\"1000\" height=\"563\"></p>\n<p><strong><img src=\"https://storage.googleapis.com/camboreport/post/202408/8D6GJKeJsjpxNX2OEWrr0gxr9nIPGSuyWueMUSyd.jpg\" width=\"1000\" height=\"100\"></strong></p>\n<p>អស់រយៈពេលជិត 8 ឆ្នាំបន្ទាប់ពីបានប្រកាសចេញ Bluetooth 5.0 កន្លងមក ប្រព័ន្ធតភ្ជាប់ឥតខ្សែ Bluetooth ជំនាន់ថ្មី 6.0 ក៏បានប្រកាសចេញជាផ្លូវការ និងបានធ្វើការអាប់ដេតល្អប្រសើរគ្រាន់បើ។ ក្រៅពីមានប្រព័ន្ធសុវត្ថិភាពខ្ពស់ជាងមុនហើយ ក៏បាននាំមកនូវមុខងារថ្មីហៅថា Channel Sounding ដែលមានសមត្ថភាពក្នុងការសម្គាល់ដឹងចម្ងាយ រវាងឧបករណ៍មួយទៅឧបករណ៍មួយទៀត។</p>\n</div>\n</div>\n<div class=\"bg-white-section\">\n<div class=\"content-container\">\n<p>ហេតុដូច្នេះហើយ Bluetooth 6.0 នឹងជួយឲ្យអ្នកប្រើប្រាស់ឆាប់ស្វែងរកឃើញឧបករណ៍របស់ពួកគេវិញបាន។ មុខងារនេះក៏មិនអនុញ្ញាតឲ្យនរណាម្នាក់ អាចចេះតែស្កេនយកទិន្នន័យរបស់អ្នកប្រើប្រាស់បានដូចមុននោះដែរ ព្រោះវាស្គាល់ឧបករណ៍បានច្បាស់លាស់ជាងមុន ថាតើជាឧបករណ៍ធ្លាប់តភ្ជាប់គ្នាពីមុនរបស់អ្នកប្រើប្រាស់។</p>\n<p><img src=\"https://storage.googleapis.com/camboreport/post/202409/ZfpqNPU0umj36ED7FLjLzmrloVQtcRkA6u0gOAqn.jpg\" alt=\"\" width=\"1000\" height=\"563\"></p>\n<p>ស្របនឹងពេលដែល Bluetooth 6.0 បានប្រកាសចេញជាផ្លូវការហើយក៏ពិតមែន ប៉ុន្ដែយើងអាចត្រូវរង់ចាំយូរទៀត ទើបបានចាប់ផ្ដើមឃើញមានឧបករណ៍ថ្មីៗ ចាប់ផ្ដើមយកមកប្រើប្រាស់ផងដែរ។</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"relate-product\">\n<div class=\"bg-white-section\">\n<div class=\"py-lg-0 py-md-0 py-sm-4 py-xs-4 py-4\">&nbsp;</div>\n</div>\n</div>\n<div class=\"pt-3 pb-2 ps-lg-0 ps-md-0 ps-sm-2 ps-xs-2 ps-2\"><span class=\"source\">ប្រភព៖ Cambo Report</span></div>', 0, '/news/CamGoTech_qdQJrjdUmPk6DbFfbVceu44IXwaI7ufxuMNGY1Gr.jpg', 60, 1, '2024-09-14 07:15:59', '2025-05-28 04:23:48', 'Camgotech News, Tech News, Website Design in Cambodia', 'Camgotech News, Tech News, Website Design in Cambodia'),
(22, 'HUAWEI MateBook Fold ជាឡេបថបអេក្រង់បត់ 18” កម្រាស់ស្ដើងត្រឹមតែ 7.3mm នៅពេលបើក', '', '<p>កាលពីពេលថ្មីៗនេះ HUAWEI បានធ្វើការប្រកាសចេញកុំព្យូទ័រយួរដៃអេក្រង់បត់ថ្មី HUAWEI MateBook Fold ជាមួយតម្លៃខ្ទង់ $3,300 នៅប្រទេសចិន ដែលមានបន្ទះអេក្រង់ tandem OLED ទំហំ 18&rdquo; បត់ចូលគ្នាបាន។ អ្វីដែលគួរឲ្យចាប់អារម្មណ៍ទៀតនោះគឺស្ថិតត្រង់ថា បន្ទះឈីបអាចជាប្រភេទ Kirin ដោយក្រុមហ៊ុនមិនបានបញ្ជាក់ប្រាប់ឡើយ ហើយមានប្រព័ន្ធប្រតិបត្តិការ HarmonyOS 5 លក្ខណៈកុំព្យូទ័រថែមទៀតផង។<br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_gXffdTaiKKlzE720g8SWpfql9Z8SwkihqNRDnwSh.jpg\" alt=\"\" width=\"100%\" height=\"100%\"><br><br>HUAWEI MateBook Fold មានទម្ងន់ 1.16kg និងកម្រាស់ 7.3mm នៅពេលបើក ក៏ដូចជាកម្រាស់ 14.9mm នៅពេលបត់ចូលគ្នា អាចបត់បានមុំ 30&deg; ដឺក្រេ ទៅ 150&deg; ដឺក្រេ និងមានជើងទម្រនៅខ្នងខាងក្រោយ។ បន្ទះអេក្រង់ទំហំ 18&rdquo; អាចបត់បាន 13&rdquo; ជាប្រភេទ tandem OLED LTPO គុណភាព 3.3K, កម្រិតពន្លឺដល់ 1600nits, 1440Hz PWC dimming និង 2,000,000:1 contrast ratio ផងដែរ។<br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_2NpPtl7LPYQDpJy3LhOdZguOR4ctt2ScGF7HIYnV.jpg\" alt=\"\" width=\"100%\" height=\"auto\"><br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_rn1OT1GlTFs2PQPpHIa8BpG76cNmsRAwlHQx228y.jpg\" alt=\"\" width=\"100%\" height=\"auto\"><br><br>ស្របនឹងពេលដែលបន្ទះឈីបត្រូវបានលាក់ទុកសិន ចំណែកឯរ៉េមមានទំហំដល់ 32GB និងមានទំហំផ្ទុក 1TB ឬ 2TB ដែលមានប៊ូតុងគាំទ្រការស្កេនក្រយ៉ៅដៃ, បាសបំពងសំឡេង 6 គ្រាប់, ម៉ាយក្រូហ្វូន 4 គ្រាប់, កាមេរ៉ាមុខ 8MP មួយគ្រាប់, Bluetooth 5.2, dual-band Wi-Fi, រន្ធ USB C ចំនួន 2 ក៏ដូចជាការប្រើប្រាស់ក្ដារចុចលើអេក្រង់ផ្ទាល់ ឬក្ដារចុចដាច់គ្នាពីខាងក្រៅក៏បាន។<br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_Tqd9ra5pLYUz5YCEk1HouUSKhnBbDlv5G49NbdUm.jpg\" alt=\"\" width=\"100%\" height=\"auto\"><br><br>ដុំសាករបស់កុំព្យូទ័រយួរដៃអេក្រង់បត់នេះមានកម្លាំង 140W សម្រាប់សាកថាមពលថ្ម 74.69Wh នៅពីខាងក្នុង ហើយអតិថិជនអាចជ្រើសរើសបានជម្រើសពណ៌ខ្មៅ, ពណ៌ខៀវ និងពណ៌ស។ សម្រាប់ជម្រើសម៉ាស៊ីន 1TB មានតម្លៃខ្ទង់ $3,328 និងជម្រើស 2TB មានតម្លៃខ្ទង់ $3,745 ដែលកំពុងដាក់ឲ្យកុម្ម៉ង់ចាប់ពីពេលនេះតទៅ និងដាក់លក់ផ្លូវការនៅថ្ងៃទី 6 មិថុនា 2025 ក្នុងប្រទេសចិនសិនប៉ុណ្ណោះ។<br><br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_es1WhxL00nA4HuBZuJliqbs7dz7t3ApkytbHxgHB.jpg\" alt=\"\" width=\"100%\" height=\"auto\"><br><br><br>ប្រភព៖ Cambo Report</p>', 1, '/news/CamGoTech_egon34MEEUj5pyDbChkubor9nqeeuQ0SbAOcHdgY.jpg', 49, 1, '2025-05-28 04:15:18', '2025-07-10 18:23:11', '', ''),
(23, 'រូបភាពថ្មីដាក់បង្ហាញពីកម្រាស់ស្ដើងរបស់ Galaxy Z Fold7 បានកាន់តែច្បាស់ជាងមុន', '', '<div class=\"bg-white-section pt-4\">\n<div class=\"content-container\">\n<p>កម្មវិធី Galaxy Unpacked ត្រៀមប្រកាសចេញ Z Fold7/Flip7 នឹងរៀបចំធ្វើឡើងនៅថ្ងៃទី 9 កក្កដា 2025 ដោយនៅពេលថ្មីៗនេះ រូបភាពកាន់តែច្បាស់អំពីស្មាតហ្វូនអេក្រង់បត់ស៊េរីថ្មីៗទាំងនេះ ក៏ត្រូវបានចែករំលែកមកលើអ៊ីនធើណេតផងដែរ។</p>\n<p><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_KBoWIsSVOwb42SoDnXe5wEvpJ2Y5XzwBZOFtJH3x.jpg\" alt=\"\" width=\"100%\" height=\"AUTO\"></p>\n<p>រូបភាពលេចធ្លាយថ្មីៗនេះបានដាក់បង្ហាញឲ្យឃើញថា Galaxy Z Fold7 នឹងមានកាមេរ៉ាបែបលក្ខណៈធម្មតាវិញ ដោយមិនមែនជាប្រភេទលាក់ក្រោមអេក្រង់ទៀតទេ សម្រាប់ផ្នែកអេក្រង់ខាងក្នុង។ ក្រៅពីនេះរូបភាពថ្មីក៏បានបង្ហាញអំពីកម្រាស់ស្ដើងខ្លាំងរបស់ Galaxy Z Fold7 បើប្រៀបធៀបទៅនឹងម៉ូឌែលជំនាន់មុន។</p>\n<p><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_UnPVHiBfeJhRd1Wk0QyMbsd8swhfjhJahbndqOlb.jpg\" alt=\"\" width=\"100%\" height=\"auto\"></p>\n<p>ចាប់ផ្ដើមពីជំនាន់ Galaxy Z Fold3 កន្លងមក ស្មាតហ្វូនអេក្រង់បត់ប្រភេទ Fold របស់ Samsung សុទ្ធតែមានកាមេរ៉ាលាក់ក្រោមអេក្រង់ ទោះបីជាយ៉ាងណាក៏ដោយ Galaxy Z Fold7 ទំនងជាត្រឡប់ទៅក្រោយវិញ ដោយធ្វើការបំពាក់កាមេរ៉ាមើលឃើញធម្មតា។<br><br></p>\n</div>\n</div>\n<div class=\"bg-white-section\">\n<div class=\"content-container\">\n<p><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_cgiyDQagVqxFHUfz6OlutowoMZvUIvGtr3UhPTgW.jpg\" alt=\"\" width=\"100%\" height=\"auto\"></p>\n<p><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_NLfWdI4YuthseIjh6PI8qikjQUl7kDQaxiE42YWO.jpg\" alt=\"\" width=\"100%\" height=\"auto\"></p>\n<p><img src=\"https://storage.googleapis.com/camboreport/post/202506/t7mnQV8CJIVs5CUQVS6ng8qLxxKQah0XhlDuzOhN.jpg\" alt=\"\" width=\"1000\" height=\"581\"></p>\n<p>នេះក៏ជាដំណឹងល្អសម្រាប់អ្នកប្រើប្រាស់ Galaxy Z Fold7 ព្រោះតែកាមេរ៉ាមើលឃើញបែបនេះ នឹងមានផ្ដល់ជូនគុណភាពបានច្បាស់ប្រសើរជាង កាមេរ៉ាលាក់ក្រោមអេក្រង់ជាក់ជាមិនខាន។</p>\n<p><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_xWKznTErI0Bll3IDiXwdWogtHKrLBHqdEzTWxnI9.jpg\" alt=\"\" width=\"100%\" height=\"auto\"></p>\n<p>&nbsp;</p>\n<p>ប្រភព៖ Cambo-Report</p>\n</div>\n</div>', 1, '/news/CamGoTech_ONijO0iyK0PzcBAb1XbqOkMwpR9HtDpd1pfuI9Uj.jpg', 0, 1, '2025-07-10 18:20:12', '2025-07-10 18:25:59', '', '');

