(7, 'Website Development', 'Professional Website Design in Cambodia Dynamic, CMS, E-commerce . . .', '<p>Website Design, Website Development, Website Design in Cambodia, Website Design in Phnom Penh, Ecommerce Website, CMS Website, WordPress, LaThe website is a place to display data, show company history, work history, achievements, and teamwork, and especially show the services, products, and contact information of a business to customers. It is a must for the digital age that every business should have​ It<br><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_vQ49KecFAF3uOeja70I2MCBwVAemf53F4xsgF2pF.png\" alt=\"\" width=\"100%\" height=\"auto\">In the development of this website, some many languages or technologies are used to create this website, and it depends on the size of the work or project of the website, which language to use to write it appropriately, and the technology itself.<br><br>Our website development services include everything from front-end design to back-end integration. We work with businesses of all sizes to deliver high-quality websites that are secure, scalable and easy to manage. Let us create a website that works for you.<br><br>Take your business to the next level with professional, modern, beautiful and secure website creation to increase sales, trust and customer relationships.<img src=\"https://api.camgotech.com/uploads/content/CamGoTech_h9IueazbHROgorblAWhg5ySflwv6gnDMARcnslci.png\" alt=\"\" width=\"100%\" height=\"auto\"><br>In addition, Camgotech has researched as well as some experience on the language to be used in writing this website, such as:<br>- PHP Programming + Laravel Framework<br>- PHP Programming + Codeigniter<br>- CMS WordPress<br>- React Native<br>- Flutter Framework<br>- Vue JS and Angular etc.<br><img src=\"https://api.camgotech.acitytech.com/uploads/content/CamGoTech_wE8ilDKDieHDh3isqHgV8QuTvYmPBI1VaL9nBppn.png\" alt=\"\" width=\"100%\" height=\"auto\"></p>\n<p><img src=\"https://api.camgotech.com/uploads/content/CamGoTech_eQnVLHf9YmW09hHSvrZfr0li2Qe7F1lvLwT8oion.png\" alt=\"\" width=\"100%\" height=\"auto\"></p>\n<p>&nbsp;</p>', 1, '/service/CamGoTech_XE82njRnTAAVjGtVfI8dy2at6pGIsLRP3eNyetnj.jpg', 1, 1, '2023-10-20 20:46:12', '2025-03-06 00:55:30', 'Website Design, Website Development, Website Design in Cambodia, Website Design in Phnom Penh, Ecommerce Website Development', 'Website Design, Website Development, Website Design in Cambodia, Website Design in Phnom Penh, Ecommerce Website, CMS Website, WordPress, Laravel, React, React Native, Flutter, Angular, Vue, PHP, Node.js, My SQL,'),
(8, 'Mobile App Development', 'Mobile Application Development App Store (IOS) and Play Store (Android) . . .', '<p>A mobile app (or mobile application) is a software application developed specifically for use on small, wireless computing devices, such as smartphones and tablets, rather than desktop or laptop computers.</p>\n<p>Mobile apps are sometimes categorized according to whether they are web-based or native apps, which are created specifically for a given platform. A third category, hybrid apps, combines elements of both native and web apps.</p>\n<p>In today\'s digital age, mobile apps are an essential part of most people\'s daily lives. From social networking and entertainment to productivity and business, mobile apps play a vital role in how we interact with technology.<br><br><strong>How are mobile apps built?</strong><br>Mobile apps are built using a variety of programming languages and frameworks, and they can be downloaded and installed from app stores such as the Apple App Store or Google Play.<br><br><img src=\"https://api.camgotech.acitytech.com/uploads/content/CamGoTech_CSAgCaSKyGZUkIKhS8J6MgYIBPfRaVPxjnD1qqpV.png\" alt=\"\" width=\"100%\" height=\"auto\"><br><br>Mobile apps are designed to provide a wide range of functions and services and with consideration for the demands, constraints and capabilities of the devices they\'re built for. For example, a gaming app might take advantage of the iPhone\'s accelerometer.<br><br><img src=\"https://api.camgotech.acitytech.com/uploads/content/CamGoTech_z0T2sVa8d7AT7VE9jAx9yhsujRTPJB5q415PLdzq.png\" alt=\"\" width=\"100%\" height=\"auto\"></p>', 1, '/service/CamGoTech_z5Qbp3d2kNZjgsjnqCaSYi39bg8iBLHfcuKrU2Os.jpg', 2, 1, '2023-10-20 20:47:05', '2025-03-06 00:56:57', 'Mobile App Development, Mobile Application Development, Mobile App development in Cambodia, Mobile App development in Phnom Penh', 'Mobile App Development, Mobile Application Development, Mobile App development in Cambodia, Mobile App development in Phnom Penh'),
(9, 'Software Development', 'Cloud System, Dental Clinic Management System, POS Star Mart & Restaurant . . .', '<div>\n<div>Cloud System, Dental Clinic Management System, POS Star Mart &amp; Restaurant System</div>\n<div>CRM System and School Management System</div>\n<div>&nbsp;</div>\n</div>', 1, '/service/CamGoTech_z9HtObLE2z8QNxqo3c1uHbhWM7DOFmACGimXw8JP.jpg', 3, 1, '2023-10-20 20:47:51', '2025-03-06 00:57:33', 'Software Development', 'Software Development'),
(10, 'Domain Register & Web Hosting', 'Stable web hosting and Domain Registration and using email . . .', '<p>Domain Name is the unique name that appears after the @ sign-in email addresses and after www. in web addresses.<br><br><img src=\"https://api.camgotech.acitytech.com/uploads/content/CamGoTech_NLWbUR2LtzNzRahT4t4JaHezyRVHTSBaKOp8dosI.png\" alt=\"\" width=\"100%\" height=\"auto\"><br><br>Web hosting is the process where a web hosting provider stores and maintains website files and applications on a server to make your websites accessible on the internet<br><br><img src=\"https://api.camgotech.acitytech.com/uploads/content/CamGoTech_ZNbOTa73iz0WIitkFsowm6dQYbpPt8oDqjcJG4um.png\" alt=\"\" width=\"100%\" height=\"auto\"><br><br>When you have a domain name &amp; web hosting, you can use email with the domain you want.<br>- Webmail<br>- Outlook<br><br><img src=\"https://api.camgotech.acitytech.com/uploads/content/CamGoTech_Bjc5oRj5f1otVPdCW5gDY7t6eiTZ7qIEklg0yTTt.png\" alt=\"\" width=\"100%\" height=\"auto\"><br><br><br><br><br></p>', 1, '/service/CamGoTech_ReMBS2gYBuPbEwEOaduRpk40qwyfuwQw4OJ6fHgY.jpg', 5, 1, '2023-10-20 20:48:44', '2023-12-12 01:48:53', NULL, ''),
(11, 'Corporate Design', 'Logo Design, Poster, Banner, Brochures, Business Card, Folder, Leaflet Design . . .', '<div>\n<div>Logo Design, Poster, Banner, Brochures, Business Card, Folder, Leaflet Design . . .</div>\n</div>', 1, '/service/CamGoTech_BZm6F3JpyIWHG3M60KvQFXPoQT8f1br5vE98qhF9.jpg', 6, 1, '2023-10-20 20:49:38', '2023-12-20 03:23:06', NULL, ''),
(12, 'Digital Marketing & SEO Solution', 'Facebook boost page and boost live, Instagram, Tiktok, Google and Youtube', '<p>Digital marketing, also called online marketing, is the promotion of brands to connect with potential customers using the Internet and other forms of digital communication. This includes not only email, social media, and web-based advertising, but also text and multimedia messages as a marketing channel.<br><br>There are several types of digital marketing that businesses can leverage to increase the demand for their products and services. Here are some popular digital marketing types:<br><br></p>\n<h3 class=\"rich-text-component css-18fte31 e1tiznh50\">Social media marketing (SMM)</h3>\n<h3 class=\"rich-text-component css-18fte31 e1tiznh50\"><br><img src=\"https://api.camgotech.acitytech.com/uploads/content/CamGoTech_eQKEhes1Zdhn3YdRCEA0kqvfbW8TBblFJrRuXfpZ.png\" alt=\"\" width=\"100%\" height=\"auto\"></h3>\n<p>Social media provides an interactive platform for customers and businesses. Various social media platforms are available and companies can leverage this to forge an interactive relationship with their customers. Using this type of media platform allows businesses to advertise their products directly to prospective buyers and ask for feedback from the buyers.&nbsp;<br><br></p>\n<h3 class=\"rich-text-component css-18fte31 e1tiznh50\">Search Engine Optimization (SEO)</h3>\n<h3 class=\"rich-text-component css-18fte31 e1tiznh50\">Content marketing</h3>\n<h3 class=\"rich-text-component css-18fte31 e1tiznh50\">Email marketing</h3>\n<h3 class=\"rich-text-component css-18fte31 e1tiznh50\">Affiliate marketing<br>- - -</h3>\n<h3 class=\"rich-text-component css-18fte31 e1tiznh50\"><br><br></h3>', 1, '/service/CamGoTech_w9Vm5v8t5e84dyaiyfHJus4FWdG8uecduSSWiIqt.jpg', 4, 1, '2023-11-15 02:00:57', '2025-01-30 01:58:48', NULL, '');

