INSERT INTO `site_settings` (`id`, `type`, `content`, `created_at`, `updated_at`) VALUES
(1, 'ABOUT_COMPANY', '{\"companyName\":\"Camgotech\",\"aboutCompany\":\"We are ready to provide our best services to you with reasonable cost and quality of services and the very best solutions, and we look forward to having the chance to discuss all your problems and what you need.\",\"thumbnail\":\"\\/site-setting\\/CamGoTech_fXlGyf44KMscW9AM79JScKYKGnqdExwSoVHedkuU.png\"}', '2023-10-28 22:30:39', '2025-01-30 18:24:39'),
(2, 'WHO_WE_ARE', '{\"title\":\"We are <b>All Services<\\/b> of IT solution & digital marketing\",\"description\":\"Camgotech is a web design and mobile application development team in Phnom Penh, Cambodia. We specialize in creating high-quality custom websites and mobile apps tailored to your business needs. Whether you are a small business startup or an enterprise, we offer innovative and easy-to-use web solutions to help you build a strong online presence. <br\\/> <br\\/>\\nWe are ready to provide our best services to you with reasonable cost and quality of services and very best solutions and we look forward to have chance to discussing with you all problem you have and what you need.\",\"thumbnail\":\"\\/site-setting\\/CamGoTech_JLZVA7TUPBMkyn4m132D6hogxiIhpIexr6A5R6xn.png\"}', '2023-10-30 08:12:06', '2025-02-13 22:47:13'),
(3, 'OUR_GOAL', '{\"title\":\"Your <b>Trusted Partner<\\/b> for digital marketing\",\"description\":\"To become a trusted leader in website development by delivering high-quality, innovative, and scalable digital solutions. <br\\/> <br\\/>\\nWe provide you with affordable prices and quality services, luxury, high responsibility and the best solution for you.\",\"thumbnail\":\"\\/site-setting\\/CamGoTech_GrWVJxwNqCXOOSABHlzGTorUWSlPKZygmFEt68Bs.jpg\",\"vision\":\"Our main vision is to make all businesses in Cambodia use high technology to easily manage data and online advertising systems, easily locate addresses or contact numbers and easily connect to  all businesses in the world. More than that, I want the international community to know Cambodia.\",\"mission\":\"Camgotech does everything we can to keep your data stable and secure, and we are committed to ensuring that we have the best solution for our website design services, mobile app development, and continued to provide awesome products and services good until the future  . . . .  We make your business better\",\"ourvalue\":\"High responsibility is a great value that every business should have and maintain well at all times and in all places, no matter how big or small the job.\\nCreativity and innovation are a must-have for all design activities and must be monitored to find the best one for the work we are doing.\",\"thumbnailTwo\":\"\"}', '2023-10-30 08:47:55', '2025-02-13 23:31:00'),
(4, 'SERVICE', '{\"title\":\"Go with us <b>Quality<\\/b> first\",\"description\":\"We are ready to provide our best services to you with reasonable cost and quality of services and the very best solutions\"}', '2023-10-31 07:04:24', '2024-01-29 02:14:58'),
(5, 'WHY_CHOOSE_US', '{\"title\":\"We help you <b>To Increase<\\/b> your sale on your website & app\",\"description\":\"This is our work process for website design, mobile app development and all projects with the customization you need\"}', '2023-10-31 07:09:07', '2024-01-29 02:13:24'),
(6, 'PROJECT', '{\"title\":\"Your project is <b>The Best<\\/b> and most attractive because we care\",\"description\":\"We have many customers and he is satisfied with our work, you can check and leave your feedback for us at any time to improve the next job.\"}', '2023-10-31 07:15:39', '2024-01-29 02:03:39'),
(7, 'TESTIMONIAL', '{\"title\":\"Some <b>Sweet Feedback<\\/b> of our happy clients\",\"description\":\"We are so happy to hear that you are enjoying your Project. Please let us know if we can help you with anything further, and thank you for taking your time  to leave us this super kind review.\"}', '2023-10-31 07:29:12', '2024-01-29 02:14:16'),
(8, 'WEB_HOSTING', '{\"title\":\"Our best <b>Web Hosting<\\/b> all kinds of your business\",\"description\":\"Take a look at our hosting package and choose one for your business website that comes with email usage and has 7 days full support.\"}', '2023-10-31 07:29:52', '2024-01-29 02:08:25'),
(9, 'TECH_NEWS', '{\"title\":\"Read Our <b>Tech News<\\/b> To Get Knowledge\",\"description\":\"We have the latest technology news to keep readers up to date with the latest technology in the world\"}', '2023-10-31 07:30:58', '2025-03-14 02:50:33'),
(10, 'CONTACT', '{\"email1\":\"info@camgotech.com\",\"email2\":\"tvutha@camgotech.com\",\"phoneNumber1\":\"012 358 333\",\"phoneNumber2\":\"069 565 956\",\"address\":\"No. 4Eo, St. 112, Sangkat Phsar Depo 3, Khan Toul Kork, Phnom Penh, Cambodia.\",\"embedMap\":\"https:\\/\\/www.google.com\\/maps\\/embed?pb=!1m18!1m12!1m3!1d3908.7547603593457!2d104.90320877526557!3d11.569430444065972!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3109516da457553b%3A0xbd1a498fb8b01914!2sCamgotech%20Business%20Solution!5e0!3m2!1sen!2skh!4v1698820204497!5m2!1sen!2skh\",\"facebookLink\":\"https:\\/\\/www.facebook.com\\/camgotech\",\"instagramLink\":\"https:\\/\\/www.instagram.com\\/camgotech\",\"telegramLink\":\"https:\\/\\/t.me\\/camgotech\",\"linkedinLink\":\"https:\\/\\/www.linkedin.com\\/in\\/camgotech\\/\",\"appId\":\"1014325969686728\",\"pageId\":\"camgotech\",\"thumbnail\":\"\\/site-setting\\/CamGoTech_FZgG6b0aU1FYbnaH47UZsqH5tUVqYjTTuTxjOfHf.png\",\"contactFormEmail\":\"info@camgotech.com\"}', '2023-10-31 08:54:55', '2024-12-12 21:08:40'),
(11, 'SKILLSET', '{\"title\":\"We have A <b>Team of High Quality<\\/b> professionals that you trust\",\"description\":\"\",\"thumbnail\":\"\\/site-setting\\/CamGoTech_J5yqnrv4N55EmeZHuNq4CKSUWneiaSEjD79jOed8.png\"}', '2023-10-31 09:27:07', '2024-01-29 02:14:41'),
(12, 'TERM_SERVICE', '{\"thumbnail\":\"\\/site-setting\\/CamGoTech_2jy0pujhH95m2GGspJTwngGREBDvlo2XyaSP1Jgz.jpg\",\"description\":\"\"}', '2023-11-09 10:01:15', '2024-03-11 05:03:21'),
