(4, 'Mr. SAM', 'Patty Trading Co., Ltd.', 'The Camgotech Team offers a modern and clean website design service for Patty Trading Co ., Ltd. We recommend Camgotech to anyone in Cambodia who is seeking a website design solution.', '/testimonial-profile/CamGoTech_zqPp85ZMlMTDHunyNjf4gfcwmKyDJ87TziGmaHrJ.jpg', 1, 3, 1, '2023-12-13 06:06:56', '2023-12-13 06:32:24');

